import React, {Component} from 'react';
import Header from '../Common/Header'
class Home extends Component
{
    render()
    {
        return(
            <div>
                <Header
                    title="Welcomne To Our Laboratory!"
                    subtitile="Medical Imaging And Diagnoses"
                    button
                />
            </div>
        )
    }
}

export default Home;
